--2
drop table if exists employees;
drop table if exists departments;
drop table if exists locations;
create table locations(
	location_id serial primary key,
	street_address varchar(25),
	postal_code varchar(12),
	city varchar(30),
	state_province varchar(12)
);
create table departments(
	department_id serial primary key,
	department_name varchar(50) unique,
	budget integer,
	location_id integer references locations
);
create table employees(
	employee_id serial primary key,
	first_name varchar(50),
	last_name varchar(50),
	email varchar(50),
	phone_number varchar(20),
	salary integer,
	department_id integer references departments
);






select * from locations;
select * from departments;
select * from employees;

--3
select first_name, last_name, e.department_id, d.department_name from employees e 
join departments d on e.department_id = d.department_id;

--4
select first_name,last_name,e.department_id,d.department_name from employees e
join departments d on e.department_id = d.department_id
where e.department_id = 80 or e.department_id = 40;

--5
select first_name,last_name,d.department_name,l.city,l.state_province from employees e
join departments d on e.department_id = d.department_id
join locations l on d.location_id = l.location_id;

--6
select * from departments;
select * from departments d left join employees e on d.department_id = e.department_id; 


--7
select first_name,last_name,e.department_id,d.department_name from employees e left join
departments d on d.department_id = e.department_id;